Extending the ValidationError vom joi with normal Error, so that it can be used with [Boom](https://github.com/hapijs/boom) (from the hapi ecosystem).

In Boom types you can find the following line:
`export function wrap(error: Error, statusCode?: number, message?: string): BoomError;`

Now you can write something like:

```
var result = Joi.validate(payload, schema);
if (result.error) {
     return Boom.wrap(result.error, 400);
 }
```

Pull request #966 attempted to implement an overload to `angular.IPromise<T>.then(...)` to return `angular.IHttpPromise<T>` instances:
- a0b3d5f added an overload as follows:

``` ts
then<TResult>(successCallback: (promiseValue: T) => IHttpPromise<TResult>, errorCallback?: (reason: any) => any): IHttpPromise<TResult>;
```

However this change caused compilation errors.
- 8c6037d fixed this by changing the overload as follows:

``` ts
then<TResult>(successCallback: (promiseValue: T) => IHttpPromise<TResult>, errorCallback?: (reason: any) => any): IPromise<TResult>;
```

This change, effectively reversed the intent of the pull request.

When pull request #3488 introduced union types. This code started to fail in my **TypeScript 1.5.3** setup:

``` ts
var promise: angular.IPromise<string>;
var httpPromise: angular.IHttpPromise<number>;

var result = promise.then(result => {
    return httpPromise;
});
```

The returned error is:

```
Error   23  The type argument for type parameter 'TResult' cannot be inferred from the usage. Consider specifying the type arguments explicitly.
  Type argument candidate 'IHttpPromiseCallbackArg<number>' is not a valid type argument because it is not a supertype of candidate 'number'.
```

`angular.IPromise<T>.then(...): angular.IHttpPromise<T>` never really got implemented, and shouldn't be (according to the deprecation notice in https://docs.angularjs.org/api/ng/service/$http#get).

This will help create better typed instances. 
Example usage:

``` js
export interface UserInstance extends Sequelize.Instance<UserInstance, UserAttrib>, UserAttrib {
    getRole: Sequelize.BelongsToAssociationGetMixin<RoleInstance>;
    setRole: Sequelize.BelongsToAssociationSetMixin<RoleInstance, RoleId>;
    createRole: Sequelize.BelongsToAssociationCreateMixin<RoleAttrib>;
}
```

Where types are defined as below:

``` js

export type RoleId = number;

export interface RoleAttrib {
    id?: RoleId;
    name?: string;
    description?: string;
    users?: UserAttrib[];
}
export interface RoleInstance extends Sequelize.Instance<RoleInstance, RoleAttrib>, RoleAttrib { }
export interface RoleModel extends Sequelize.Model<RoleInstance, RoleAttrib> { }
```

Now `getRole`, `setRole` and `createRole` are properly defined (semi-manually) on the type UserInstance.

- gl-matrix**-module**.d.ts hides all glMatrix objects within a `GLM` namespace.
- gl-matrix**-module**.d.ts exposes a named AMD module `gl-matrix`.
- gl-matrix.d.ts now wraps around gl-matrix**-module**.d.ts, and re-exposes the objects in the global scope.

Example of old behavior (still supported):

``` js
// After running tsd install gl-matrix
/// <reference path="typings/gl-matrix.d.ts" />
mat4.create();
```

Example of new behavior:

``` js
// After running tsd install gl-matrix
import { mat4 } from "gl-matrix";
mat4.create();
```

